$bannerBytes = [Convert]::FromBase64String($base64Banner)
$bannerStream = New-Object System.IO.MemoryStream(,$bannerBytes)
$bannerImage = [System.Drawing.Image]::FromStream($bannerStream)

$form = New-Object System.Windows.Forms.Form
$form.Text = "PimpMyWindows - HoneyBadger Edition"
$form.Size = New-Object System.Drawing.Size(500,300)
$form.StartPosition = "CenterScreen"
$form.FormBorderStyle = "FixedDialog"
$form.MaximizeBox = $false
$form.BackColor = [System.Drawing.Color]::FromArgb(30,30,30)
$form.Icon = New-Object System.Drawing.Icon($ms)
#$form.BackgroundImage = New-Object System.Drawing($bannerImage)

$pictureBox = New-Object System.Windows.Forms.PictureBox
$pictureBox.Image = $bannerImage
$pictureBox.SizeMode = "Zoom"
$pictureBox.Size = New-Object System.Drawing.Size(460,80)
$pictureBox.Location = New-Object System.Drawing.Point(15,30)
$form.Controls.Add($pictureBox)

$secureButton = New-Object System.Windows.Forms.Button
$secureButton.Text = "Secure Mode"
$secureButton.Size = New-Object System.Drawing.Size(140,40)
$secureButton.Location = New-Object System.Drawing.Point(30,130)
$secureButton.BackColor = 'Blue'
$secureButton.ForeColor = 'White'
$secureButton.Font = 'Segoe UI, 10pt'
$secureButton.Add_Click({
    $logDir = "$env:USERPROFILE\HoneySecureLogs"
    if (-not (Test-Path $logDir)) { New-Item -ItemType Directory -Path $logDir | Out-Null }

    $timestamp = Get-Date -Format "yyyyMMdd-HHmmss"
    $logPath = "$logDir\SecureMode-$timestamp.txt"
    Add-Content $logPath "=== HoneyBadger Secure Mode Activated @ $timestamp ==="

    [System.Windows.Forms.MessageBox]::Show("Secure Mode launched. Changes will be logged to:`n$logPath", "Secure Mode")

    try {
        # 1. Disable SMBv1
        $smb1 = (Get-SmbServerConfiguration).EnableSMB1Protocol
        Add-Content $logPath "## Default_Secure: SMBv1 = $smb1"

        Set-SmbServerConfiguration -EnableSMB1Protocol $false -Force
        Add-Content $logPath "## SET SMBv1 = false"

        # 2. Disable LLMNR
        $llmnr = Get-ItemPropertyValue -Path "HKLM:\SOFTWARE\Policies\Microsoft\Windows NT\DNSClient" -Name "EnableMulticast" -ErrorAction SilentlyContinue
        Add-Content $logPath "## Default_Secure: LLMNR.EnableMulticast = $llmnr"

        Set-ItemProperty -Path "HKLM:\SOFTWARE\Policies\Microsoft\Windows NT\DNSClient" -Name "EnableMulticast" -Value 0 -Force
        Add-Content $logPath "## SET LLMNR.EnableMulticast = 0"

        # 3. Enable Defender Real-time Protection
        $defenderStatus = (Get-MpPreference).DisableRealtimeMonitoring
        Add-Content $logPath "## Default_Secure: Defender.RealtimeMonitoring = $defenderStatus"

        Set-MpPreference -DisableRealtimeMonitoring $false
        Add-Content $logPath "## SET Defender: DisableRealtimeMonitoring = false"

        # 4. Enable SmartScreen
        $smartScreenPath = "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer"
        $currentSmartScreen = Get-ItemPropertyValue -Path $smartScreenPath -Name "SmartScreenEnabled" -ErrorAction SilentlyContinue
        Add-Content $logPath "## Default_Secure: SmartScreenEnabled = $currentSmartScreen"

        Set-ItemProperty -Path $smartScreenPath -Name "SmartScreenEnabled" -Value "RequireAdmin" -Force
        Add-Content $logPath "## SET SmartScreenEnabled = RequireAdmin"

        # 5. Set ExecutionPolicy to AllSigned
        $currentExecPolicy = Get-ExecutionPolicy -Scope LocalMachine
        Add-Content $logPath "## Default_Secure: ExecutionPolicy.LocalMachine = $currentExecPolicy"

        Set-ExecutionPolicy -ExecutionPolicy AllSigned -Scope LocalMachine -Force
        Add-Content $logPath "## SET ExecutionPolicy: LocalMachine = AllSigned"

        # 6. Disable AutoRun
        $autorun = Get-ItemPropertyValue -Path "HKCU:\Software\Microsoft\Windows\CurrentVersion\Policies\Explorer" -Name "NoDriveTypeAutoRun" -ErrorAction SilentlyContinue
        Add-Content $logPath "## Default_Secure: NoDriveTypeAutoRun = $autorun"

        Set-ItemProperty -Path "HKCU:\Software\Microsoft\Windows\CurrentVersion\Policies\Explorer" -Name "NoDriveTypeAutoRun" -Value 255 -Force
        Add-Content $logPath "## SET NoDriveTypeAutoRun = 255"

        # 7. Force Network Location to Private
        Add-Content $logPath "## Default_Secure: NetworkLocationCategory = [GET ONLY]"

        Get-NetConnectionProfile | Set-NetConnectionProfile -NetworkCategory Private
        Add-Content $logPath "## SET NetworkLocationCategory = Private"

        # 8. Disable Remote Registry
        $remoteRegistryStatus = (Get-Service -Name RemoteRegistry).StartType
        Add-Content $logPath "## Default_Secure: RemoteRegistry.StartType = $remoteRegistryStatus"

        Stop-Service -Name RemoteRegistry -Force
        Set-Service -Name RemoteRegistry -StartupType Disabled
        Add-Content $logPath "## SET RemoteRegistry.StartType = Disabled"

        # 9. Ensure Firewall is On
        $firewallStatus = (Get-NetFirewallProfile -Profile Domain,Public,Private).Enabled -join ","
        Add-Content $logPath "## Default_Secure: FirewallProfiles.Enabled = $firewallStatus"

        Set-NetFirewallProfile -Profile Domain,Public,Private -Enabled True
        Add-Content $logPath "## SET FirewallProfiles.Enabled = True"

        # 10. Enable CmdLine Logging
        $cmdLineAudit = Get-ItemPropertyValue -Path "HKLM:\Software\Microsoft\Windows\CurrentVersion\Policies\System\Audit" -Name "ProcessCreationIncludeCmdLine_Enabled" -ErrorAction SilentlyContinue
        Add-Content $logPath "## Default_Secure: CmdLineAudit = $cmdLineAudit"

        Set-ItemProperty -Path "HKLM:\Software\Microsoft\Windows\CurrentVersion\Policies\System\Audit" -Name "ProcessCreationIncludeCmdLine_Enabled" -Value 1 -Force
        Add-Content $logPath "## SET CmdLineAudit = 1"

        Add-Content $logPath "=== Secure Mode Complete ==="
        [System.Windows.Forms.MessageBox]::Show("Secure Mode complete. Log saved to:`n$logPath", "Secure Complete")
    }
    catch {
        Add-Content $logPath "!! ERROR: $_"
        [System.Windows.Forms.MessageBox]::Show("Secure Mode error: $_", "Error")
    }
})
$form.Controls.Add($secureButton)

$tradecraftButton = New-Object System.Windows.Forms.Button
$tradecraftButton.Text = "Tradecraft Mode"
$tradecraftButton.Size = New-Object System.Drawing.Size(140,40)
$tradecraftButton.Location = New-Object System.Drawing.Point(320,130)
$tradecraftButton.BackColor = 'Red'
$tradecraftButton.ForeColor = 'White'
$tradecraftButton.Font = 'Segoe UI, 10pt'
$tradecraftButton.Add_Click({
    $logDir = "$env:USERPROFILE\HoneySecureLogs"
    if (-not (Test-Path $logDir)) { New-Item -ItemType Directory -Path $logDir | Out-Null }

    $timestamp = Get-Date -Format "yyyyMMdd-HHmmss"
    $logPath = "$logDir\SecureMode-$timestamp.txt"  # Unified log naming for restore compatibility
    Add-Content $logPath "=== HoneyBadger Tradecraft Mode Activated @ $timestamp ==="

    if (-not ([Security.Principal.WindowsPrincipal] [Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole("Administrator")) {
    Start-Process powershell -Verb runAs -ArgumentList "-File `"$PSCommandPath`""
    return
}

    [System.Windows.Forms.MessageBox]::Show("Tradecraft Mode launched. Actions logged to:`n$logPath", "Tradecraft Mode")

    try {
        # 1. Disable Defender Realtime Protection
        $defenderStatus = (Get-MpPreference).DisableRealtimeMonitoring
        Add-Content $logPath "## Default_Tradecraft: Defender.RealtimeMonitoring = $defenderStatus"

        Set-MpPreference -DisableRealtimeMonitoring $true
        Add-Content $logPath "## SET Defender: DisableRealtimeMonitoring = true"

        # 2. Set PowerShell ExecutionPolicy (Process Scope)
        $currentExecPolicy = Get-ExecutionPolicy -Scope Process
        Add-Content $logPath "## Default_Tradecraft: ExecutionPolicy.Process = $currentExecPolicy"

        Set-ExecutionPolicy -ExecutionPolicy Bypass -Scope Process -Force
        Add-Content $logPath "## SET ExecutionPolicy: Process = Bypass"

        # 3. Disable SmartScreen
        $smartScreenPath = "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer"
        $currentSmartScreen = Get-ItemPropertyValue -Path $smartScreenPath -Name "SmartScreenEnabled" -ErrorAction SilentlyContinue
        Add-Content $logPath "## Default_Tradecraft: SmartScreenEnabled = $currentSmartScreen"

        Set-ItemProperty -Path $smartScreenPath -Name "SmartScreenEnabled" -Value "Off" -Force
        Add-Content $logPath "## SET SmartScreenEnabled = Off"

        # 4. Launch RedOps payload (if found)
        $payloadPath = "$env:USERPROFILE\HoneyBadgerOps\Invoke-RedOps.ps1"
        if (Test-Path $payloadPath) {
            Start-Process powershell -WindowStyle Hidden -ArgumentList "-NoProfile -ExecutionPolicy Bypass -File `"$payloadPath`""
            Add-Content $logPath "## EXEC RedOpsPayload = $payloadPath"
        } else {
            Add-Content $logPath "## WARN RedOpsPayloadNotFound = $payloadPath"
        }

        # 5. Tradecraft persona flag (for future GUI linkage)
        Add-Content $logPath "## Persona: NULLviper"

        Add-Content $logPath "=== Tradecraft Mode Complete ==="
        [System.Windows.Forms.MessageBox]::Show("Tradecraft Mode executed. System modified.`nCheck log for actions.", "Tradecraft Complete")
    }
    catch {
        Add-Content $logPath "!! ERROR: $_"
        [System.Windows.Forms.MessageBox]::Show("Tradecraft Mode error: $_", "Error")
    }
})
$form.Controls.Add($tradecraftButton)

$exitButton = New-Object System.Windows.Forms.Button
$exitButton.Text = "Exit"
$exitButton.Size = New-Object System.Drawing.Size(100,30)
$exitButton.Location = New-Object System.Drawing.Point(195,180)
$exitButton.BackColor = [System.Drawing.Color]::FromArgb(45, 45, 45)
$exitButton.ForeColor = [System.Drawing.Color]::White
$exitButton.Add_Click({ $form.Close() })
$form.Controls.Add($exitButton)

$restoreButton = New-Object System.Windows.Forms.Button
$restoreButton.Text = "Restore Mode"
$restoreButton.Size = New-Object System.Drawing.Size(140, 40)
$restoreButton.Location = New-Object System.Drawing.Point(175, 130)
$restoreButton.BackColor = 'Gray'
$restoreButton.ForeColor = 'White'
$restoreButton.Font = 'Segoe UI, 10pt'
$restoreButton.Add_Click({
    $logDir = "$env:USERPROFILE\HoneySecureLogs"
    $lastLog = Get-ChildItem $logDir -Filter "SecureMode-*.txt" | Sort-Object LastWriteTime -Descending | Select-Object -First 1

    if (-not $lastLog) {
        [System.Windows.Forms.MessageBox]::Show("No log found to restore from.", "Restore Mode")
        return
    }

    $logLines = Get-Content $lastLog.FullName
    [System.Windows.Forms.MessageBox]::Show("Restoring from:`n$($lastLog.FullName)", "Restore Mode")

    try {
        foreach ($line in $logLines) {

            switch -Regex ($line) {

                # SMBv1
                '## Default_(Secure|Tradecraft): SMBv1\s*=\s*(True|False)' {
                    $value = $Matches[2] -eq 'True'
                    Set-SmbServerConfiguration -EnableSMB1Protocol $value -Force
                    Add-Content $lastLog.FullName "## UNDO: SMBv1 = $value"
                }

                # LLMNR
                '## Default_(Secure|Tradecraft): LLMNR\.EnableMulticast\s*=\s*(\d)' {
                    $value = [int]$Matches[2]
                    Set-ItemProperty -Path "HKLM:\SOFTWARE\Policies\Microsoft\Windows NT\DNSClient" -Name "EnableMulticast" -Value $value -Force
                    Add-Content $lastLog.FullName "## UNDO: LLMNR.EnableMulticast = $value"
                }

                # Defender
                '## Default_(Secure|Tradecraft): Defender\.RealtimeMonitoring\s*=\s*(True|False)' {
                    $value = $Matches[2] -eq 'True'
                    Set-MpPreference -DisableRealtimeMonitoring $value
                    Add-Content $lastLog.FullName "## UNDO: Defender.RealtimeMonitoring = $value"
                }

                # Execution Policy
                '## Default_(Secure|Tradecraft): ExecutionPolicy\.(Process|LocalMachine)\s*=\s*(\w+)' {
                    $scope = $Matches[1]
                    $value = $Matches[2]
                    Set-ExecutionPolicy -Scope $scope -ExecutionPolicy $value -Force
                    Add-Content $lastLog.FullName "## UNDO: ExecutionPolicy.$scope = $value"
                }

                # SmartScreen
                '## Default_(Secure|Tradecraft): SmartScreenEnabled\s*=\s*(\w+)' {
                    $value = $Matches[1]
                    Set-ItemProperty -Path "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer" -Name "SmartScreenEnabled" -Value $value -Force
                    Add-Content $lastLog.FullName "## UNDO: SmartScreenEnabled = $value"
                }

                # AutoRun
                '## Default_(Secure|Tradecraft): NoDriveTypeAutoRun\s*=\s*(\d+)' {
                    $value = [int]$Matches[1]
                    Set-ItemProperty -Path "HKCU:\Software\Microsoft\Windows\CurrentVersion\Policies\Explorer" -Name "NoDriveTypeAutoRun" -Value $value -Force
                    Add-Content $lastLog.FullName "## UNDO: NoDriveTypeAutoRun = $value"
                }

                # Remote Registry
                '## Default_(Secure|Tradecraft): RemoteRegistry\.StartType\s*=\s*(\w+)' {
                    $startup = $Matches[1]
                    Set-Service -Name RemoteRegistry -StartupType $startup
                    if ($startup -ne 'Disabled') { Start-Service -Name RemoteRegistry -ErrorAction SilentlyContinue }
                    Add-Content $lastLog.FullName "## UNDO: RemoteRegistry.StartType = $startup"
                }

                # Firewall
                '## Default_(Secure|Tradecraft): FirewallProfiles\.Enabled\s*=\s*(.+)' {
                    $values = $Matches[1] -split ',' | ForEach-Object { $_.Trim() }
                    $profiles = 'Domain','Public','Private'
                    for ($i = 0; $i -lt $profiles.Length; $i++) {
                        $enabled = $values[$i] -eq 'True'
                        Set-NetFirewallProfile -Profile $profiles[$i] -Enabled:$enabled
                        Add-Content $lastLog.FullName "## UNDO: FirewallProfile.$($profiles[$i]) = $enabled"
                    }
                }

                # CmdLine Audit
                '## Default_(Secure|Tradecraft): CmdLineAudit\s*=\s*(\d)' {
                    $value = [int]$Matches[1]
                    Set-ItemProperty -Path "HKLM:\Software\Microsoft\Windows\CurrentVersion\Policies\System\Audit" -Name "ProcessCreationIncludeCmdLine_Enabled" -Value $value -Force
                    Add-Content $lastLog.FullName "## UNDO: CmdLineAudit = $value"
                }
            }
        }

        [System.Windows.Forms.MessageBox]::Show("Restore complete.`nAll values set to original state.", "Restore Complete")
    }
    catch {
        [System.Windows.Forms.MessageBox]::Show("Error during restore: $_", "Error")
    }
})
$form.Controls.Add($restoreButton)

$exportButton = New-Object System.Windows.Forms.Button
$exportButton.Text = "Export Undo .ps1"
$exportButton.Size = New-Object System.Drawing.Size(140, 30)
$exportButton.Location = New-Object System.Drawing.Point(175, 220)
$exportButton.BackColor = 'Orange'
$exportButton.ForeColor = 'Black'
$exportButton.Font = 'Segoe UI, 9pt'
$exportButton.Add_Click({
    $logDir = "$env:USERPROFILE\HoneySecureLogs"
    $lastLog = Get-ChildItem $logDir -Filter "SecureMode-*.txt" | Sort-Object LastWriteTime -Descending | Select-Object -First 1

    if (-not $lastLog) {
        [System.Windows.Forms.MessageBox]::Show("No log found to generate undo script.", "Export Undo")
        return
    }

    $exportPath = "$logDir\Restore-From-$($lastLog.BaseName).ps1"
    $logLines = Get-Content $lastLog.FullName
    $undoScript = @()
    $undoScript += "### HoneyBadger Restore Script from $($lastLog.Name)"
    $undoScript += "### Generated: $(Get-Date)"
    $undoScript += ""

    foreach ($line in $logLines) {
        switch -Regex ($line) {
            '## Default_.*: SMBv1\s*=\s*(True|False)' {
                $v = $Matches[1].ToLower()
                $undoScript += "Set-SmbServerConfiguration -EnableSMB1Protocol $v -Force"
            }
            '## Default_.*: LLMNR\.EnableMulticast\s*=\s*(\d)' {
                $v = $Matches[1]
                $undoScript += 'Set-ItemProperty -Path "HKLM:\SOFTWARE\Policies\Microsoft\Windows NT\DNSClient" -Name "EnableMulticast" -Value ' + $v + ' -Force'
            }
            '## Default_.*: Defender\.RealtimeMonitoring\s*=\s*(True|False)' {
                $v = $Matches[1].ToLower()
                $undoScript += "Set-MpPreference -DisableRealtimeMonitoring $v"
            }
            '## Default_.*: ExecutionPolicy\.(Process|LocalMachine)\s*=\s*(\w+)' {
                $scope = $Matches[1]
                $val = $Matches[2]
                $undoScript += "Set-ExecutionPolicy -Scope $scope -ExecutionPolicy $val -Force"
            }
            '## Default_.*: SmartScreenEnabled\s*=\s*(\w+)' {
                $v = $Matches[1]
                $undoScript += 'Set-ItemProperty -Path "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer" -Name "SmartScreenEnabled" -Value "' + $v + '" -Force'
            }
            '## Default_.*: NoDriveTypeAutoRun\s*=\s*(\d+)' {
                $v = $Matches[1]
                $undoScript += 'Set-ItemProperty -Path "HKCU:\Software\Microsoft\Windows\CurrentVersion\Policies\Explorer" -Name "NoDriveTypeAutoRun" -Value ' + $v + ' -Force'
            }
            '## Default_.*: RemoteRegistry\.StartType\s*=\s*(\w+)' {
                $v = $Matches[1]
                $undoScript += "Set-Service -Name RemoteRegistry -StartupType $v"
                if ($v -ne "Disabled") {
                    $undoScript += "Start-Service -Name RemoteRegistry -ErrorAction SilentlyContinue"
                }
            }
            '## Default_.*: FirewallProfiles\.Enabled\s*=\s*(.+)' {
                $arr = $Matches[1] -split ',' | ForEach-Object { $_.Trim() }
                $p = 'Domain','Public','Private'
                for ($i = 0; $i -lt $arr.Count; $i++) {
                    $undoScript += "Set-NetFirewallProfile -Profile $($p[$i]) -Enabled:$($arr[$i])"
                }
            }
            '## Default_.*: CmdLineAudit\s*=\s*(\d)' {
                $v = $Matches[1]
                $undoScript += 'Set-ItemProperty -Path "HKLM:\Software\Microsoft\Windows\CurrentVersion\Policies\System\Audit" -Name "ProcessCreationIncludeCmdLine_Enabled" -Value ' + $v + ' -Force'
            }
        }
    }

    $undoScript | Set-Content -Encoding UTF8 $exportPath
    [System.Windows.Forms.MessageBox]::Show("Undo script exported to:`n$exportPath", "Export Complete")
})
$form.Controls.Add($exportButton)


[void]$form.ShowDialog()
